import React from 'react';
// import Pad from './Pad';

class PadBank extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            displayPadBank: false
        }
    };

    render() {

        const displayPadBank = this.state.displayPadBank

        return (
        <div className="drum-pad">
            {displayPadBank ? "Pad bank is displayed" : "Nothing"}
        </div>
        )
    };
};

export default PadBank;
